import React from 'react';
import Sidebar from './components/Sidebar'
import { BrowserRouter, Routes, Route} from 'react-router-dom'

const App = () => {
  return (
    <div>
        <BrowserRouter>
          <Routes>
            <Route path='/' element={<Home/>}></Route>
          </Routes>
        </BrowserRouter>
    </div>
  )
}

export default App;
